import { createSlice } from "@reduxjs/toolkit";

const urlBackTo = createSlice({
    name: "url",
    initialState: {
        urlBackTo: []
    },
    reducers: {
        savaUrL: (state, action) => {

        }
    },
});

export const { savaUrL } = urlBackTo.actions;
export const selectUrl = (state) => state.url;
export default urlBackTo.reducer;
